import React, { Component} from "react";
import "./tasks-filter.css";

class TasksFilter extends Component{

    state = {
        All: this.props.allTodo,
        Active: this.props.activeTodo,
        Completed: this.props.activeTodo,

    }

    render() {
        const {butEl} = this.props
        return (
            <li key={butEl.id }>
                <button onClick={this.state.butEl.text} className={butEl.className}>{butEl.text}</button>
            </li>
        );
    }
}

export default TasksFilter;
